import React from "react";

export default function Paginate({ videogamesPerPage, videogames, paging }) {
    const pageNumbers = [];

    for (let i = 0; i <= Math.ceil(videogames / videogamesPerPage); i++) {
        pageNumbers.push(i);
    }
    return (
        <nav>
            <ul>
                {pageNumbers &&
                    pageNumbers.map((number, index) => {
                        return (
                            <li key={index}>
                                <a href={() => paging(number)}>{number}</a>
                            </li>

                        )
                    })}
            </ul>
        </nav>
    )
}
